B.Md=new A.bQ("26","BOGE C R Screw Compressor (Up to 7.5kW)","Compact screw compressor mounted on a compressed air receiver, oil lubricated.","assets/images/cc-boge-c-r-screw-compressor-7.5kw.png","AIR COMPRESSOR","","Wherever space plays a role, the BOGE C\u2026R series comes into its own, because its small footprint allows it to be installed at the workplace, right where it is needed. Each of the individual elements \u2013 from the receiver to the optional refrigerant dryer and oil/water separator \u2013 come ready assembled and are delivered as a compact unit, ready for connection. In addition, the super silenced sound insulation ensures particularly quiet running. The pre-assembled pipework ensures that both the installation work and the space required are kept to an absolute minimum.","","Compact design\n\nWith receiver\n\nExtremely quiet\n\nMaximum efficiency")
B.Me=new A.bQ("1","TRANSAIR\xae CONDITION MONITORING SENSORS & HARDWARE","Transair Conditioning Monitoring\u2019s wireless sensors and cloud-based software allows you to monitor your compressed air system remotely and from anywhere.","assets/images/cc-parker-transair-condition-monitoring-sensors-and-hardware.png","ACCESSORIES","","With our line of pressure/vacuum, humidity, temperature, power, and flow sensors you can prevent costly downtime while identifying system improvement areas. In environments where tight process controls are required, system alerts can be set-up to warn you if a given measurement falls outside the set acceptable range. These customizable alerts save valuable time by pushing the right information to you and your team via text or email.\n\nTransair Condition Monitoring provides you with the right data to make information-based decisions for managing your compressed air system. Through the easy-to-use, web-based interface you have convenient access to system status and analytics from any location and at any time. You can also discover new insights by viewing sensor measurements presented in trend charts that allow for historical trending and direct data download.\n\nEach sensor is powered by a battery that is rated to last 3 years. (Battery life is dependent on the frequency of data being sent to the cloud.) A collection server is needed to collect the data and send it to the cloud. To fit your needs, a cellular or ethernet version of the collection server is available. The collection server ships with an M-Card installed, allowing for up to 500 sensors to be joined to the network.","Customisable system alerts\n\nWireless signal strength and battery voltage reported in software\n\nData buffer storage for communications interruptions\n\nData transmission to the cloud through wireless, Ethernet or cellular options\n\n3 year battery life\n\nEasy installation\n\n1 year warranty on sensors and hardware\n\n","")
